import React from 'react';

function AccountSettings({ showAccountSettings, toggleAccountSettings }) {
  return (
    <div className="details-container">
      <button className="expand-button highlight" onClick={toggleAccountSettings}>
        {showAccountSettings ? "Hide" : "Show"} Account Settings
      </button>
      {showAccountSettings && (
        <ul className="user-details">
          <li>Change Password</li>
          <li>Update Email</li>
          <li>Manage Two-Factor Authentication</li>
          <li>Delete Account</li>
        </ul>
      )}
    </div>
  );
}

export default AccountSettings;
